env_i32 _env_atoi32(char* a, env_i64 digits) 
{
    char m = 0;
    if (digits>1&&*(a+1) == 'o') {
        m = 1;
        a+=2;
        digits-=2;
    }
    else if (digits>1&&*(a+1) == 'x') {
        m = 2;
        a+=2;
        digits-=2;
    }
    env_i32 n = 0;
    env_i8 i;
    for (i=0; i<digits ;++i) {
        double f;
        env_i8 v;
        switch (m) {
        case 0:
            f = n_pow10(digits-i-1);
            v = (a[i]-48);
            break;
        case 1:
            f = n_pow8(digits-i-1);
            v = (a[i]-48);
            break;
        case 2:
            f = n_pow16(digits-i-1);
            // hex is a special case.
           
            if (a[i]>='a') {
                v = 10 + a[i]-'a';
            }
            else if (a[i]>='A') {
                v = 10 + a[i]-'A';
            } else {
                v = (a[i]-48);
            }
            break;
        }
        n += v * f;
    }
    return n;
}

env_i64 _env_atoi64(a, digits) 
char *a;
env_i64 digits;
{
    char m = 0;
    if (digits>1&&*(a+1) == 'o') {
        m = 1;
        a+=2;
        digits-=2;
    }
    else if (digits>1&&*(a+1) == 'x') {
        m = 2;
        a+=2;
        digits-=2;
    }
    env_i64 n = 0;
    env_i8 i;
    for (i=0; i<digits ;++i) {
        double f;
        env_i8 v;
        switch (m) {
        case 0:
            f = n_pow10(digits-i-1);
            v = (a[i]-48);
            break;
        case 1:
            f = n_pow8(digits-i-1);
            v = (a[i]-48);
            break;
        case 2:
            f = n_pow16(digits-i-1);
            // hex is a special case.
            v = (a[i]-48);
            if (v>'a') {
                v = 10 + v-'a';
            }
            break;
        }
        n += v * f;
    }
    return n;
}

env_f32 _env_atof32(a, len) 
char *a;
env_i64 len;
{
    env_i8 i;
    // get . indx
    env_i8 dt_i = 0;
    for (i=0; i<len ;++i) {
        if (a[i]=='.') {
            dt_i = i;
            break;
        }
    }

    env_f32 f = 0;
    for (i=0; i<len ;++i) {
        if (i<dt_i) {
            double p = n_pow10(dt_i-i-1);
            f += (a[i]-48) * p;
        }
        else if (i>dt_i) {
            double p = n_pow10(i-dt_i);
            f += (a[i]-48) / p;
        }
    }
    return f;
}

